import React from 'react';
import { Link } from 'react-router-dom';

function NavBar({ user, setUser, artworks, setArtworks }) {
    function logout(){
        setUser(null);
    }



    return(
        <header>
            <div>
                <Link to="/">Raregifs</Link>
            </div>
            <div>
                {user ? (
                    <>
                        {/* <Link to="/upload" user={user} artworks={artworks} setArtworks={setArtworks}>Upload</Link> */}
                        <Link to="/upload" user={user} artworks={artworks} >Upload</Link>
                        <button onClick={logout} >logout</button>
                    </>
                ) : (
                    <>
                        <Link to="/login">Login</Link>
                        <Link to="/signup">Signup</Link>
                    </>
                )}
            </div>
        </header>
    ) 
}

export default NavBar;
